package Arraylabs;

public class length {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String numbers [][] = {{"al","vel","gel","lek"}, {"kel","hel","pel"}};
		for(int i=0; i<numbers.length; i++) {
			for(int j = 0; j<numbers[i].length; j++) {
				System.out.println(numbers[i][j]);
				
			}
		}
	}

}
